import React from 'react';
import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Route, Switch} from "react-router-dom";

import { Home } from './src/shared/pages/home/home.jsx';
import { Education } from './src/shared/pages/education/education.jsx';
import { Lesson } from './src/shared/pages/education/lesson.jsx';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

      </header>
      <Router>
        <Switch>
          <Route path="/" component={Home} exact />
          <Route path="/education" component={Education} exact />
          <Route exact path="/education/:lessonID" render={(props) => <Lesson {...props} />} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
